      return (
        <div key={index}>
          <p>{category.type}</p>
        </div>
      );
    });
  };
  return (
    <nav>
      <ul>
        <li>
          <AllCategories onSaveAllCategoris={onSaveAllCategoris} />
        </li>
      </ul>
